import { jsPDF } from "jspdf";
var font =
  "";
var callAddFont = function () {
  this.addFileToVFS("Elan ITC W04 Black-bolditalic.ttf", font);
  this.addFont(
    "Elan ITC W04 Black-bolditalic.ttf",
    "Elan ITC W04 Black",
    "bolditalic"
  );
};
jsPDF.API.events.push(["addFonts", callAddFont]);
